function AuthForm() {
  return (
    <div className="AuthForm">
      <form>
        <label>
          <input placeholder="Name"></input>
          <input type="email" placeholder="Email"></input>
          <input type="password" placeholder="Password"></input>
        </label>
      </form>
    </div>
  );
}

export default AuthForm;
